import{_ as t,a as e,b as r,c as o}from"./chunks/mro_control_pinouts.lUp8_FjF.js";import{_ as a,c as l,o as i,ab as n}from"./chunks/framework.CUflZczI.js";const k=JSON.parse('{"title":"mRo Control Zero F7 비행 콘트롤러","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/mro_control_zero_f7.md","filePath":"ko/flight_controller/mro_control_zero_f7.md"}'),s={name:"ko/flight_controller/mro_control_zero_f7.md"},d=n('<h1 id="mro-control-zero-f7-비행-콘트롤러" tabindex="-1">mRo Control Zero F7 비행 콘트롤러 <a class="header-anchor" href="#mro-control-zero-f7-비행-콘트롤러" aria-label="Permalink to &quot;mRo Control Zero F7 비행 콘트롤러&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4에서는 이 제품을 제조하지 않습니다. 하드웨어 지원과 호환 문제는 <a href="https://store.mrobotics.io/" target="_blank" rel="noreferrer">제조사</a>에 문의하십시오.</p></div><p>The <em>mRo Control Zero F7<sup>®</sup></em> is a new flight controller from mRo.</p><p><img src="'+t+'" alt="mRo Control Zero F7"></p><p>매우 우수한 트리플 IMU 상용 등급 비행 컨트롤러입니다. 8x PWM 출력(DShot 가능), 3x IMU, 1x 자력계, 1x 기압 센서 (고도계), 6x UART 및 SD 카드가 모두 32mm x 20mm PCB에 포장되어 있습니다. PWM은 양방향이고 EMI로 보호되며 레벨이 5V 로직 레벨로 이동합니다. 모두 전면 및 후면 30 핀 Molex Pico Clasp 커넥터를 사용하여 액세스합니다. 내구성이 강한 플라스틱 케이스, 컨 포멀 보드 코팅, 온도 보정 옵션이 포함되어 있습니다.</p><p>:::note 이 비행 컨트롤러는 <a href="./../flight_controller/autopilot_manufacturer_supported.html">제조업체의 지원</a>을 받을 수 있습니다. :::</p><h2 id="주요-특징" tabindex="-1">주요 특징 <a class="header-anchor" href="#주요-특징" aria-label="Permalink to &quot;주요 특징&quot;">​</a></h2><ul><li><p>마이크로 프로세서:</p><ul><li>FPU가있는 32 비트 STM32F777 코어 텍스<sup>®</sup> M4 코어. 3</li><li>216 MHz/512 KB RAM/2 MB 플래시</li><li>F-RAM Cypress MF25V02-G 256Kbit 비휘발성 메모리(RAM만큼 빠른 플래시 메모리)</li></ul></li><li><p>센서:</p><ul><li><a href="https://www.bosch-sensortec.com/bst/products/all_products/bmi088_1" target="_blank" rel="noreferrer">Bosch BMI088</a> 3 축 가속도계/자이로스코프 (내부 진동 감쇠)</li><li><a href="https://www.invensense.com/products/motion-tracking/6-axis/icm-20602/" target="_blank" rel="noreferrer">Invensense ICM-20602</a> 3 축 가속도계/자이로스코프</li><li><a href="https://www.invensense.com/products/motion-tracking/9-axis/icm-20948/" target="_blank" rel="noreferrer">Invensense ICM-20948</a> 3 축 가속도계/자이로스코프/자력계</li><li><a href="https://www.infineon.com/cms/en/product/sensor/pressure-sensors/pressure-sensors-for-iot/dps310/" target="_blank" rel="noreferrer">Infineon DPS310 기압계</a>(부드럽고 감광성이 없음)</li></ul></li><li><p>인터페이스:</p><ul><li>6x UART(총 직렬 포트), 3x(HW 흐름 제어 포함), 1x FRSky Telemetry(D 또는 X 유형), 1x 콘솔 및 1x GPS + I2C</li><li>PWM 출력(모든 DShot 가능) 8개</li><li>CAN 1개</li><li>I2C 1개</li><li>SPI 1개</li><li>Spektrum DSM/DSM2/DSM-X® Satellite 호환 입력 및 바인딩</li><li>Futaba S.BUS® 및 S.BUS2® 호환 입력</li><li>FRSky 텔레메트리 포트 출력</li><li>Graupner SUMD</li><li>Yuneec ST24</li><li>PPM 합계 입력 신호</li><li>JTAG(TC2030 커넥터) 1개</li><li>RSSI(PWM 또는 전압) 입력 1개</li><li>삼색 LED</li></ul></li><li><p>중량 및 크기(케이스 없음):</p><ul><li>중량: 5.3g (0.19oz)</li><li>넓이: 20mm (0.79&quot;)</li><li>길이: 32mm (1.26&quot;)</li></ul></li><li><p>전원 시스템 :</p><ul><li>초저잡음 LDO 전압 조정기 3개</li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="https://store.mrobotics.io/mRo-Control-Zero-F7-p/mro-ctrl-zero-f7.htm" target="_blank" rel="noreferrer">mRo Control Zero</a></li></ul><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">대부분의 사용자들은 펌웨어를 빌드할 필요는 없습니다. It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p><p>:::</p><p>이 대상에 대한 <a href="./../dev_setup/building_px4.html">PX4 빌드</a> 방법 :</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make mro_ctrl-zero-f7</span></span></code></pre></div><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><h3 id="콘솔-포트" tabindex="-1">콘솔 포트 <a class="header-anchor" href="#콘솔-포트" aria-label="Permalink to &quot;콘솔 포트&quot;">​</a></h3><p><a href="./../debug/system_console.html">PX4 시스템 콘솔</a>은 아래에 나열된 핀을 사용하여 <code>USART7</code>에서 실행됩니다. This is a standard serial pinout, designed to connect to a <a href="https://www.digikey.com/en/products/detail/TTL-232R-3V3/768-1015-ND/1836393" target="_blank" rel="noreferrer">3.3V FTDI</a> cable (5V tolerant).</p><table><thead><tr><th>mRo control zero f7</th><th></th><th>FTDI</th></tr></thead><tbody><tr><td>17</td><td>USART7 Tx</td><td>5</td></tr><tr><td>19</td><td>USART7 Rx</td><td>4</td></tr><tr><td>6</td><td>USART21 GND</td><td>1</td></tr></tbody></table><h3 id="swd-포트" tabindex="-1">SWD 포트 <a class="header-anchor" href="#swd-포트" aria-label="Permalink to &quot;SWD 포트&quot;">​</a></h3><p>FMU 디버깅 <a href="./../debug/swd_debug.html">SWD 포트</a>(JTAG)는 아래와 같은 TC2030 디버그 커넥터입니다.</p><p><img src="'+e+'" alt="mro swd 포트"></p><p>아래의 <a href="https://www.tag-connect.com/" target="_blank" rel="noreferrer">Tag Connect</a> 케이블 <a href="https://www.tag-connect.com/product/tc2030-idc-nl" target="_blank" rel="noreferrer">TC2030 IDC NL</a> (관련 <a href="https://www.tag-connect.com/product/tc2030-clip-retaining-clip-board-for-tc2030-nl-cables" target="_blank" rel="noreferrer">고정 클립</a> 포함)을 사용하여 BlackMagic 프로브 또는 ST-LINK에 연결할 수 있습니다.</p><p><img src="'+r+'" alt="tc2030 idc nl 케이블"></p><p>다른 디버그 프로브와 함께 사용할 수있는 <a href="https://www.tag-connect.com/product/arm20-ctx-20-pin-to-tc2030-idc-adapter-for-cortex" target="_blank" rel="noreferrer">ARM20-CTX 20 핀-TC2030-IDC 어댑터</a>도 있습니다.</p><h2 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h2><p><img src="'+o+'" alt="mRo Control Zero F7"></p><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>USART2</td><td>/dev/ttyS0</td><td>TELEM1 (흐름 제어)</td></tr><tr><td>USART3</td><td>/dev/ttyS1</td><td>TELEM2 (흐름 제어)</td></tr><tr><td>UART4</td><td>/dev/ttyS2</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS3</td><td>플렉스 포트(흐름 제어를 사용하여 SPI 또는 UART로 구성할 수 있음).</td></tr><tr><td>UART7</td><td>/dev/ttyS4</td><td>콘솔</td></tr><tr><td>UART8</td><td>/dev/ttyS5</td><td>직렬 포트 여분(일반적으로 FrSky 원격 측정용)</td></tr></tbody></table><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="https://mrobotics.io/introducing-the-new-mro-control-zero-autopilot/" target="_blank" rel="noreferrer">새로운 mRo Control Zero Autopilot 소개</a> (블로그)</li><li><a href="https://mrobotics.io/mrocontrolzero/" target="_blank" rel="noreferrer">빠른 시작 가이드</a></li></ul></div>',12),c=[d];function h(p,m,u,_,b,f){return i(),l("div",null,c)}const T=a(s,[["render",h]]);export{k as __pageData,T as default};
